import './MainAboutPage.css';

function MainAboutPage() {
  return (
    <div className="main-container">
      <div className="textContainer__left">
        <h1>We are dedicated to providing the best travel experience.</h1>
        <p>Discover the Land of a Thousand Hills</p>
      </div>
      <div className="imageContainer__right" />
    </div>
  );
}

export default MainAboutPage;
